import React, { useState } from 'react';
import axios from 'axios';

function HardwareForm() {
  const [formData, setFormData] = useState({
    companyName: '',
    cnpj: '',
    vendorName: '',
    totalValue: '',
    proposalAttachment: null,
    observations: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;

    // If the input is a file input, update the formData with the selected file
    if (event.target.type === 'file') {
      const file = event.target.files[0];
      setFormData((prevFormData) => ({ ...prevFormData, [name]: file }));
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log('Dados do formulário enviados:', formData);

    // Enviar os dados do formulário para o backend
    const formDataToSend = new FormData();
    Object.entries(formData).forEach(([key, value]) => {
      formDataToSend.append(key, value);
    });

    axios
      .post('http://localhost:5000/api/send-email', formDataToSend, {
        headers: { 'Content-Type': 'multipart/form-data' },
      })
      .then((response) => {
        console.log('Resposta do backend:', response.data);
        alert('Formulário enviado com sucesso! Verifique seu email.');
      })
      .catch((error) => {
        console.error('Erro ao enviar o formulário:', error);
        alert('Ocorreu um erro ao enviar o formulário. Tente novamente mais tarde.');
      });
  };

  return (
    <div className="container">
      <h2>Formulário de Venda de Hardwares</h2>
      <form onSubmit={handleSubmit}>
        <div className="question">
          <label htmlFor="companyName">Informe o nome da Empresa:</label>
          <input
            type="text"
            id="companyName"
            name="companyName"
            value={formData.companyName}
            onChange={handleChange}
            required
          />
        </div>
        <div className="question">
          <label htmlFor="cnpj">Informe o CNPJ do cliente:</label>
          <input
            type="text"
            id="cnpj"
            name="cnpj"
            value={formData.cnpj}
            onChange={handleChange}
            required
            pattern="[0-9]{2}\.[0-9]{3}\.[0-9]{3}/[0-9]{4}-[0-9]{2}"
            placeholder="00.394.460/0058-87"
          />
        </div>
        <div className="question">
          <label htmlFor="vendorName">Informe o nome do vendedor:</label>
          <input
            type="text"
            id="vendorName"
            name="vendorName"
            value={formData.vendorName}
            onChange={handleChange}
            required
          />
        </div>
        <div className="question">
          <label htmlFor="totalValue">Informe o valor total vendido:</label>
          <input
            type="number"
            id="totalValue"
            name="totalValue"
            value={formData.totalValue}
            onChange={handleChange}
            step="0.01"
            required
          />
        </div>
        <div className="question">
          <label htmlFor="proposalAttachment">Anexe a proposta comercial:</label>
          <input
            type="file"
            id="proposalAttachment"
            name="proposalAttachment"
            onChange={handleChange}
            accept=".pdf, .doc, .docx"
            required
          />
        </div>
        <div className="question">
          <label htmlFor="observations">Campo livre para observações:</label>
          <textarea
            id="observations"
            name="observations"
            value={formData.observations}
            onChange={handleChange}
          ></textarea>
        </div>
        <button type="submit">Enviar</button>
      </form>
    </div>
  );
}

export default HardwareForm;
